import React from 'react';

function Kitchen() {
	return (
		<div className="page">
			<h1>Kitchen</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>Kitchen은 주방용품 브랜드 디자인 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>주방용품 제품 디자인</li>
					<li>패키지 및 라벨 디자인</li>
					<li>매장 디스플레이 디자인</li>
					<li>브랜드 마케팅 자료</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Adobe Creative Suite, 3D Modeling, Product Design Software</p>
			</div>
		</div>
	);
}

export default Kitchen;
